```python
import glob
import re

def update_prompt(x):
    return re.sub(
        r"(?P<start>\b)PromptTemplate\(template=(?P<template>.*), input_variables=(?:.*)\)",
        "\g<start>PromptTemplate.from_template(\g<template>)",
        x
    )


for fn in glob.glob("docs/**/*", recursive=True):
    try:
        content = open(fn).readlines()
    except:
        continue
    content = [update_prompt(l) for l in content]
    with open(fn, "w") as f:
        f.write("".join(content))
```

Script run on mypy error logs

```python
import re

to_ignore = {}
for l in logs:
    if re.match("^(.*)\:(\d+)\: error:.*\[(.*)\]", l):
        path, line_no, error_type = re.match("^(.*)\:(\d+)\: error:.*\[(.*)\]", l).groups()
        if (path, line_no) in to_ignore:
            to_ignore[(path, line_no)].append(error_type)
        else:
            to_ignore[(path, line_no)] = [error_type]

for (path, line_no), error_types in to_ignore.items():
    all_errors = ", ".join(error_types)
    full_path = f"../libs/community/{path}"
    with open(full_path, "r") as f:
        file_lines = f.readlines()
    file_lines[int(line_no)-1] = file_lines[int(line_no)-1][:-1] + f"  # type: ignore[{all_errors}]\n"
    with open(full_path, "w") as f:
        f.write("".join(file_lines))
```

